import Layout from "../../components/ui/Layout";

import { Button, ButtonGroup } from 'react-bootstrap';

const Home = ({ children }) => {
    return (
        <Layout>
            <div>RESTAURANT TINDER APP</div>
            <p>Press the button to login</p>
            <ButtonGroup>
                <Button>Login</Button>
            </ButtonGroup>
            {children}
        </Layout>
    );
}
export default Home;
